// JobsPage.js
import React, { useState } from 'react';
import './JobsPage.css';

const JobsPage = () => {
  const [jobs, setJobs] = useState([
    {
      id: 1,
      ship: 'Unknown Ship',
      component: 'engine',
      type: 'inspection',
      priority: 'high',
      status: 'in progress',
      startDate: 'May 12, 2025 01:38',
      assignedTo: 'Unassigned'
    },
    // Additional sample jobs
    {
      id: 2,
      ship: 'Ocean Queen',
      component: 'propeller',
      type: 'repair',
      priority: 'medium',
      status: 'pending',
      startDate: 'May 10, 2025 14:20',
      assignedTo: 'John Doe'
    },
    {
      id: 3,
      ship: 'Marine Express',
      component: 'navigation',
      type: 'maintenance',
      priority: 'low',
      status: 'completed',
      startDate: 'May 5, 2025 09:15',
      assignedTo: 'Jane Smith'
    }
  ]);

  const [filterShip, setFilterShip] = useState('All Ships');
  const [filterStatus, setFilterStatus] = useState('All Statuses');
  const [filterPriority, setFilterPriority] = useState('All Priorities');

  const updateJobStatus = (jobId, newStatus) => {
    setJobs(jobs.map(job => 
      job.id === jobId ? { ...job, status: newStatus } : job
    ));
  };

  const filteredJobs = jobs.filter(job => {
    return (
      (filterShip === 'All Ships' || job.ship === filterShip) &&
      (filterStatus === 'All Statuses' || job.status === filterStatus) &&
      (filterPriority === 'All Priorities' || job.priority === filterPriority)
    );
  });

  const ships = [...new Set(jobs.map(job => job.ship))];
  const statuses = [...new Set(jobs.map(job => job.status))];

  return (
    <div className="jobs-page">
      <div className="sidebar">
        <h2>Dashboard</h2>
        <ul>
          <li>Ship Management</li>
          <li className="active">Jobs</li>
          <li>Components</li>
          <li>Dark Mode</li>
          <li>Logout</li>
        </ul>
      </div>

      <div className="main-content">
        <h1>ShipMaster</h1>
        <div className="filters">
          <div className="filter-group">
            <label>Filter by Ship:</label>
            <select 
              value={filterShip} 
              onChange={(e) => setFilterShip(e.target.value)}
            >
              <option value="All Ships">All Ships</option>
              {ships.map(ship => (
                <option key={ship} value={ship}>{ship}</option>
              ))}
            </select>
          </div>

          <div className="filter-group">
            <label>Filter by Status:</label>
            <select 
              value={filterStatus} 
              onChange={(e) => setFilterStatus(e.target.value)}
            >
              <option value="All Statuses">All Statuses</option>
              {statuses.map(status => (
                <option key={status} value={status}>
                  {status.charAt(0).toUpperCase() + status.slice(1)}
                </option>
              ))}
            </select>
          </div>

          <div className="filter-group">
            <label>Filter by Priority:</label>
            <select 
              value={filterPriority} 
              onChange={(e) => setFilterPriority(e.target.value)}
            >
              <option value="All Priorities">All Priorities</option>
              <option value="high">High</option>
              <option value="medium">Medium</option>
              <option value="low">Low</option>
            </select>
          </div>
        </div>

        <div className="table-container">
          <JobsTable jobs={filteredJobs} updateJobStatus={updateJobStatus} />
        </div>
      </div>
    </div>
  );
};

const JobsTable = ({ jobs, updateJobStatus }) => {
  const handleComplete = (jobId) => {
    updateJobStatus(jobId, 'completed');
  };

  const formatDate = (dateString) => {
    // In a real app, you would use a proper date formatting library
    return dateString;
  };

  return (
    <table className="jobs-table">
      <thead>
        <tr>
          <th>Job ID</th>
          <th>Ship</th>
          <th>Component</th>
          <th>Type</th>
          <th>Priority</th>
          <th>Status</th>
          <th>Start Date</th>
          <th>Assigned To</th>
          <th>Actions</th>
        </tr>
      </thead>
      <tbody>
        {jobs.length > 0 ? (
          jobs.map(job => (
            <tr key={job.id}>
              <td>#{job.id}</td>
              <td>{job.ship}</td>
              <td>{job.component}</td>
              <td>{job.type}</td>
              <td className={`priority-${job.priority}`}>
                {job.priority.charAt(0).toUpperCase() + job.priority.slice(1)}
              </td>
              <td>
                <span className={`status-${job.status.replace(' ', '-')}`}>
                  {job.status.charAt(0).toUpperCase() + job.status.slice(1)}
                </span>
              </td>
              <td>{formatDate(job.startDate)}</td>
              <td>{job.assignedTo}</td>
              <td>
                <button className="view-btn">View</button>
                <button className="edit-btn">Edit</button>
                {job.status !== 'completed' && (
                  <button 
                    className="complete-btn"
                    onClick={() => handleComplete(job.id)}
                  >
                    Complete
                  </button>
                )}
              </td>
            </tr>
          ))
        ) : (
          <tr>
            <td colSpan="9" className="no-jobs">
              No jobs found matching your filters
            </td>
          </tr>
        )}
      </tbody>
    </table>
  );
};

export default JobsPage;
